import gmpy2
import math

from gmpy2 import mpz


def cm_attack(e1, n1, c1, e2, n2, c2):

  if n1 != n2:
    print('n1 != n2. cannnot use common modulus attack.')

  gcd, s1, s2 = gmpy2.gcdext(e1, e2)
  if gcd != 1:
    print('gcd(e1, e2) is not 1. cannnot use common modulus attack.')
    return None

  m = (pow(c1, s1, n1) * pow(c2, s2, n2)) % n1
  return m
  


